import React from "react"
import './App.css'
import Nav from './Navbar'
import Aboutcont from "./About/Aboutcont";
import Footer from './Footer.js';  //footer.js

const About = () =>{
  return(
    <div style={{paddingBottom:"50px"}}>
    <Nav/>
    <Aboutcont/>
    <Footer/>
    
    </div>
  )
}

export default About
